export default function Bienvenido(techSkills) {
  // el c칩digo de tu componente ac치

  const TechList = ({ techs }) => {
    return techs.map((tech) => <li>{tech}</li>);
  };

  return (
    <div>
      <h1>Hola</h1>
      <h3>
        <TechList tech={techSkills} />
      </h3>
      <ul></ul>
    </div>
  );
}

